import './Footer.css'
function Footer() {
  return (
    <div className='footer-container'>
        <p>Hellow</p>
        <div className="footer-contact">
            Contact Info
        </div>

        <div className="footer-links">
            <div className="footer-link-wrapper">
                <div className="footer-link-items">

                </div>
            </div>
        </div>
    </div>

  );
}

export default Footer;
